import {Card} from "react-bootstrap"

function TablaBody(data){

return data.data.map((item,index)=>{
    return(
        <div className="col-2">
            <Card>
                <ul className="list-group"> 
                <li className="list-group-item " key={index} onClick={(event)=> data.handleComida(event, item)}>
                    <h2>{item.nombre}</h2>
                    <h3>Precio:${item.precio}</h3>
                </li>
                </ul>
            </Card>
        </div>
  
  
    );
})
    }
   
   function TablaComidas(props){
        return TablaBody(props)
    }

    export default TablaComidas;
